import { GET_PROJECTS } from "../actions/projects";

const initialState = {
  projects: [],
  loading: true,
};

export default function (state = initialState, action) {
  const { type, payload } = action;

  switch (type) {
    case GET_PROJECTS:
      return {
        ...state,
        ...projects,
        payload,
      };
    default:
      return state;
  }
}
